  [],\n\t\"revision_timestamp\": \"2015-07-23T03:27:35.228868\",\n\t\"name\": \"final-environmental-statement-acquisition-of-lands-for-the-san-francisco-bay-national-wild\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Federal Government proposes to acquire
  approximately 23,000 acres of land in the South San Francisco Bay region, Alameda,
  San Mateo and Santa Clara Counties, to be included in a national wildlife refuge
  for protection of fish and wildlife and to provide opportunities for wildlife oriented
  recreation and nature study within the open space so provided. As part of this proposal,
  certain acquired salt ponds would be reserved to the Leslie Salt Company under an
  easement agreement with the right to continue producing salt therein by the solar
  evaporation process.  The principal impact would be the preservation of natural
  values of the bay with emphasis on protection for wildlife. Related benefits would
  be the provision of wildlife oriented public recreation and education. Other impacts
  relate to possible loss of direct tax revenues, support of existing restrictions
  on development opportunities and regulation of personal activities.\",\n\t\"license_title\":
